import styled from "styled-components";

const Input = styled.input`
    font-size: 1.2em;
    text-align: left;
    margin: 0.5%;
`

function InputComponent(props) {
    return (
        <Input placeholder = {props.placeholder}></Input>
    );
}

export default InputComponent;
